import groovy.util.XmlSlurper

def response = new XmlSlurper().parseText(context.expand( '${Retrieve DEO to Confirm Create#Response#declare namespace ns1=\'http://exacttarget.com/wsdl/partnerAPI\'; //ns1:RetrieveResponseMsg[1]}' ))

if( context.loopIndex == null )
context.loopIndex = 0
def numberOfTimes = context.expand( '${#TestCase#numberOfTimes}' ).toInteger()
log.info response.Results.Properties.Property.Value
if ( response.Results.Properties.Property.Value != "chris.allen@salesforce.comJan_1_8040" ) {
  if ( ++context.loopIndex <  numberOfTimes ) {
    log.info "DEO not created yet"
    sleep(1000)
    testRunner.gotoStepByName( "Retrieve DEO to Confirm Create" )
  }
  else {
    log.info "Timeout, test should fail"
    testRunner.fail("DEO not created after " + numberOfTimes.toString() + " retrieve attempts, timing out")
  }
}
else {
  log.info "DEO created"
  testRunner.gotoStepByName( "Update DataExtensionObject" ) 
}

