import groovy.util.XmlSlurper

def response = new XmlSlurper().parseText(context.expand( '${Retrieve DEO to Confirm Delete#Response#declare namespace ns1=\'http://exacttarget.com/wsdl/partnerAPI\'; //ns1:RetrieveResponseMsg[1]}' ))

if( context.loopIndex == null )
context.loopIndex = 0
def numberOfTimes = context.expand( '${#TestCase#numberOfTimes}' ).toInteger()


if ( response.Results.ObjectID.size() > 0 ) {
  if ( ++context.loopIndex <  numberOfTimes ) {
    log.info "DEO not deleted yet"
    sleep(1000)
    testRunner.gotoStepByName( "Retrieve DE to Confirm Delete" )
  }
  else {
    log.info "Timeout, test should fail"
    testRunner.fail("DEO not deleted after " + numberOfTimes.toString() + " retrieve attempts, timing out")
  }
}
else {
  log.info "DEO deleted"
}
